package main

import (
	"bytes"
	"encoding/base64"
	"flag"
	"fmt"
	"os"
	"strconv"
	"strings"
	"time"

	"fyne.io/fyne/v2/app"
	"fyne.io/fyne/v2/canvas"
)

const (
	tip string = "图片提醒操作: \r\napp -p tip.jpg -t 10s \r\n"
)

var (
	imageFilePath string
	times         string
	defaultValue  bool
)

// 读取默认配置
func init() {
	flag.BoolVar(&defaultValue, "xxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxx-", false, tip)
	flag.StringVar(&imageFilePath, "p", "", "name: 图片文件路径. \r\nvalue: 非必传. ")
	flag.StringVar(&times, "t", "", "name: 提醒时间. \r\nvalue: (s/m/h)非必传. ")
}

func main() {

	flag.Parse()
	d, ok := checkTimes(times)
	if !ok {
		fmt.Println(ErrorStr("提醒时间格式不正确"))
		return
	}

	if imageFilePath != "" {
		if !PathExists(imageFilePath) {
			fmt.Println(ErrorStr("图片文件路径不存在"))
			return
		}
	}
	time.Sleep(d)
	runImage(imageFilePath)
}

func checkTimes(s string) (time.Duration, bool) {
	var ok bool
	var d time.Duration
	if s != "" {
		if strings.Contains(s, "s") {
			temp, err := strconv.Atoi(s[:len(s)-1])
			if err == nil && temp > 0 {
				d = time.Second * time.Duration(temp)
				ok = true
			}
		} else if strings.Contains(s, "m") {
			temp, err := strconv.Atoi(s[:len(s)-1])
			if err == nil && temp > 0 {
				d = time.Minute * time.Duration(temp)
				ok = true
			}
		} else if strings.Contains(s, "h") {
			temp, err := strconv.Atoi(s[:len(s)-1])
			if err == nil && temp > 0 {
				d = time.Hour * time.Duration(temp)
				ok = true
			}
		}
	} else {
		d = time.Second * 1
		ok = true
	}
	return d, ok
}

func runImage(p string) {
	myApp := app.New()
	w := myApp.NewWindow("Go Go Go!")
	var image *canvas.Image
	if p != "" {
		image = canvas.NewImageFromFile(p)
	} else {
		buf := getBuf()
		image = canvas.NewImageFromReader(bytes.NewReader(buf), "icon.jpg")
	}

	image.FillMode = canvas.ImageFillOriginal
	w.SetContent(image)

	w.ShowAndRun()
}

func ErrorStr(v string) string {
	beforeStr := "\r\n-----------------------------------------------\r\n"
	afterStr := "\r\n-----------------------------------------------\r\n"
	return beforeStr + "执行报错: " + v + "\r\n请重试!!!" + afterStr
}

func PathExists(path string) bool {
	_, err := os.Stat(path)
	if err == nil {
		return true
	}
	if os.IsNotExist(err) {
		return false
	}
	return false
}

func getBuf() []byte {
	cc := ""
	dist, _ := base64.StdEncoding.DecodeString(cc)
	return dist
}
